import "./Line.css";
import "./Lab1EmptyList.css";

function Line(props) {
    function emptyCheck(props) {
        return (
            props.value !== ""
        );
    }
    function lineLogic(props) {
        if (emptyCheck(props)) {
            return <li><input className={"checkboxes"} type={"checkbox"}></input>
                <input className={"textboxes"} type={"text"} value={props.value}></input></li>
        }
        else {
            return <li><input className={"textboxes"} type={"text"} disabled={"disabled"} value={props.value}></input></li>
        }
    }
return (
    <div className={"all-lines"}>
        {emptyCheck(props) &&
            <li><input className={"checkboxes"} type={"checkbox"}></input>
                <input className={"textboxes"} type={"text"} value={props.value}></input></li>
        }

    </div>
)
}

export default Line;
